void N_water_props::get_prop_derivatives(
    const double T,
    const double D,
    double * __restrict dPdD_T,
    double * __restrict dhdD_T,
    double * __restrict dsdD_T,
    double * __restrict dPdT_D,
    double * __restrict dhdT_D,
    double * __restrict dsdT_D,
    double * __restrict dDdP_T,
    double * __restrict dDdT_P,
    double * __restrict pres,
    double * __restrict enth,
    double * __restrict entr
    )
    {
    Element e;
    if (T < T_crit)
        {
        const double dens_vap = water_sat_vap_dens(T);
        const double dens_liq = water_sat_liq_dens(T);
        if (D < dens_liq && D > dens_vap)
            {
            find_element(T, dens_liq, &e);
            const double x_liq = (dens_liq - e.x_low) * e.inv_dx;
            const double y_liq = (T - e.y_low) * e.inv_dy;
            double f_liq, dfdD_liq, dfdD2_liq, dfdT_liq, dfdDdT_liq, dfdT2_liq;
            get_derivatives(x_liq, y_liq, dens_liq, &e, &f_liq, &dfdD_liq, &dfdD2_liq, &dfdT_liq, &dfdDdT_liq, &dfdT2_liq);
            find_element(T, dens_vap, &e);
            const double x_vap = (dens_vap - e.x_low) * e.inv_dx;
            const double y_vap = (T - e.y_low) * e.inv_dy;
            double f_vap, dfdD_vap, dfdD2_vap, dfdT_vap, dfdDdT_vap, dfdT2_vap;
            get_derivatives(x_vap, y_vap, dens_vap, &e, &f_vap, &dfdD_vap, &dfdD2_vap, &dfdT_vap, &dfdDdT_vap, &dfdT2_vap);
            
            const double dome_width = dens_liq - dens_vap;
            const double d_dens_liq_dT = water_sat_liq_dens_derivative(T);
            const double d_dens_vap_dT = water_sat_vap_dens_derivative(T);
            const double Q = (dens_vap * (dens_liq - D)) / (D * dome_width);
            const double enth_liq = f_liq - T * dfdT_liq + dens_liq * dfdD_liq;
            const double enth_vap = f_vap - T * dfdT_vap + dens_vap * dfdD_vap;

            const double delta = d_dens_liq_dT - d_dens_vap_dT;
            const double part_a = ((dens_liq - D) * d_dens_vap_dT + dens_vap * d_dens_liq_dT) * dome_width;
            const double part_b = (D - dens_liq) * delta * dens_vap;
            const double dQdT = (part_a + part_b) / (D * dome_width * dome_width);

            const double part_c = 2.0 * dfdD_vap * d_dens_vap_dT;
            const double part_d = dens_vap * (dfdDdT_vap + dfdD2_vap * d_dens_vap_dT);

            double enth_liq_dT = 2.0 * dfdD_liq * d_dens_liq_dT;
            double enth_vap_dT = 2.0 * dfdD_vap * d_dens_vap_dT;
            enth_liq_dT = enth_liq_dT - T * (dfdT2_liq + dfdDdT_liq * d_dens_liq_dT);
            enth_vap_dT = enth_vap_dT - T * (dfdT2_vap + dfdDdT_vap * d_dens_vap_dT);
            enth_liq_dT = enth_liq_dT + dens_liq * (dfdDdT_liq + dfdD2_liq * d_dens_liq_dT);
            enth_vap_dT = enth_vap_dT + dens_vap * (dfdDdT_vap + dfdD2_vap * d_dens_vap_dT);

            const double part_e = (-dfdT2_liq - dfdDdT_liq * d_dens_liq_dT) + dQdT * (dfdT_liq - dfdT_vap);
            const double part_f = (-dfdT2_vap - dfdDdT_vap * d_dens_vap_dT) + dfdT2_liq + dfdDdT_liq * d_dens_liq_dT;

            *dPdD_T = 0.0;
            *dhdD_T = (enth_liq - enth_vap) * dens_liq * dens_vap / (D * D * dome_width);
            *dsdD_T = (dfdT_vap - dfdT_liq) * dens_liq * dens_vap / (D * D * dome_width);
            *dPdT_D = dens_vap * (part_c + part_d);
            *dhdT_D = enth_liq_dT + Q * (enth_vap_dT - enth_liq_dT) + dQdT * (enth_vap - enth_liq);
            *dsdT_D = part_e + Q * part_f;
            *dDdP_T = -9.0e99;  // NaN: 1/dPdD_T = 1/0
            *dDdT_P = -9.0e99;  // undefined for two-phase?
            *pres = dens_vap * dens_vap * dfdD_vap;
            *enth = enth_liq + Q * (enth_vap - enth_liq);
            *entr = Q * (dfdT_liq - dfdT_vap) - dfdT_liq;  // negative signs change order of terms
            return;
            }
        }

    find_element(T, D, &e);
    const double x = (D - e.x_low) * e.inv_dx;
    const double y = (T - e.y_low) * e.inv_dy;
    double f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2;
    get_derivatives(x, y, D, &e, &f, &dfdD, &dfdD2, &dfdT, &dfdDdT, &dfdT2);

    *dPdD_T = 2.0 * D * dfdD + D * D * dfdD2;
    *dhdD_T = 2.0 * dfdD - T * dfdDdT + D * dfdD2;
    *dsdD_T = -dfdDdT;
    *dPdT_D = D * D * dfdDdT;
    *dhdT_D = D * dfdDdT - T * dfdT2;
    *dsdT_D = -dfdT2;
    *dDdP_T = 1.0 / (2.0 * D * dfdD + D * D * dfdD2);
    *dDdT_P = -D * D * dfdDdT / (2.0 * D * dfdD + D * D * dfdD2);
    *pres = D * D * dfdD;
    *enth = f - T * dfdT + D * dfdD;
    *entr = -dfdT;
    return;
    }

int water_TP( const double T, const double P, water_state * __restrict state )
    {
    const int max_iter = 20;
    const double rel_tol = 1e-10;
    const double P_tol = fmax(rel_tol, P * rel_tol);
    double dens_vap = 0.0;
    double dens_liq = 0.0;
    double D;
    if (P < P_lower_limit)
        {
        zero_state(state);
        return 203;   
        }
    if (P > P_upper_limit)
        {
        zero_state(state);
        return 204;   
        }
    if (T < T_crit)
        {
        if (T < T_lower_limit)
            {
            zero_state(state);
            return 201;   
            }
        dens_vap = water_sat_vap_dens(T);
        dens_liq = water_sat_liq_dens(T);
        double sat_P;
        Element e;
        find_element(T, dens_vap, &e);
        const double x = (dens_vap - e.x_low) * e.inv_dx;
        const double y = (T - e.y_low) * e.inv_dy;
        double cy[6];
        for ( int i = 0; i < 6; ++i )
            {
            cy[i] = e.c[0][i] * y + e.c[1][i];
            cy[i] = cy[i] * y + e.c[2][i];
            cy[i] = cy[i] * y + e.c[3][i];
            cy[i] = cy[i] * y + e.c[4][i];
            cy[i] = cy[i] * y + e.c[5][i];
            }
        if (e.x_low < D_form_switch)
            {
            sat_P = dens_vap * dens_vap * (((((4.0 * cy[0]) * x + 3.0 * cy[1]) * x + 2.0 * cy[2]) * x + cy[3]) * e.inv_dx + cy[5] / dens_vap);
            }
        else
            {
            sat_P = dens_vap * dens_vap * ((((((5.0 * cy[0]) * x + 4.0 * cy[1]) * x + 3.0 * cy[2]) * x + 2.0 * cy[3])) * x + cy[4]) * e.inv_dx;
            }
        if (P < sat_P)
            {
            D = water_pt_vap_dens(P, T);  // state is vapor
            }
        else if (P > sat_P)
            {
            D = water_pt_liq_dens(P, T);  // state is liquid
            }
        else
            {
            zero_state(state);
            return 205;  // state is undefined                
            }
        }
    else if (T > T_upper_limit)
        {
        zero_state(state);
        return 202;        
        }
    else
        {
        D = water_pt_vap_dens(P, T);  // state is superheated or supercritical
        }

    Element e;
    double x, f, dfdD, dfdD2, dfdT, dfdT2, dfdDdT;
    find_element(T, D, &e);
    const double y = (T - e.y_low) * e.inv_dy;
    double cy[6], cy_dT[6], cy_dT2[6];
    for ( int i = 0; i < 6; ++i )
        {
        cy[i] = e.c[0][i] * y + e.c[1][i];
        cy_dT[i] = e.c[0][i] * y + cy[i];
        cy[i] = cy[i] * y + e.c[2][i];
        cy_dT2[i] = e.c[0][i] * y + cy_dT[i];
        cy_dT[i] = cy_dT[i] * y + cy[i];
        cy[i] = cy[i] * y + e.c[3][i];
        cy_dT2[i] = cy_dT2[i] * y + cy_dT[i];
        cy_dT[i] = cy_dT[i] * y + cy[i];
        cy[i] = cy[i] * y + e.c[4][i];
        cy_dT2[i] = 2.0 * (cy_dT2[i] * y + cy_dT[i]);
        cy_dT[i] = cy_dT[i] * y + cy[i];
        cy[i] = cy[i] * y + e.c[5][i];
        }    
    int iter;
    for ( iter = 0; iter < max_iter; ++iter )
        {
        x = (D - e.x_low) * e.inv_dx;
        
        if (x < -0.01 || x > 1.01)  // outside element
            {
            find_element(T, D, &e);
            const double y = (T - e.y_low) * e.inv_dy;
            for ( int i = 0; i < 6; ++i )
                {
                cy[i] = e.c[0][i] * y + e.c[1][i];
                cy_dT[i] = e.c[0][i] * y + cy[i];
                cy[i] = cy[i] * y + e.c[2][i];
                cy_dT2[i] = e.c[0][i] * y + cy_dT[i];
                cy_dT[i] = cy_dT[i] * y + cy[i];
                cy[i] = cy[i] * y + e.c[3][i];
                cy_dT2[i] = cy_dT2[i] * y + cy_dT[i];
                cy_dT[i] = cy_dT[i] * y + cy[i];
                cy[i] = cy[i] * y + e.c[4][i];
                cy_dT2[i] = 2.0 * (cy_dT2[i] * y + cy_dT[i]);
                cy_dT[i] = cy_dT[i] * y + cy[i];
                cy[i] = cy[i] * y + e.c[5][i];
                }                
            x = (D - e.x_low) * e.inv_dx;
            }
        
        if (e.x_low < D_form_switch)
            {
            dfdD = 4.0 * cy[0] * x + 3.0 * cy[1];
            dfdD2 = 4.0 * cy[0] * x + dfdD;
            dfdD = dfdD * x + 2.0 * cy[2];
            dfdD2 = dfdD2 * x + dfdD;
            dfdD = dfdD * x + cy[3];
            dfdD2 = dfdD2 * e.inv_dx * e.inv_dx;
            dfdD = dfdD * e.inv_dx;
            dfdD2 = dfdD2 - cy[5] / (D * D);
            dfdD = dfdD + cy[5] / D;
            }
        else
            {
            dfdD = 5.0 * cy[0] * x + 4.0 * cy[1];
            dfdD2 = 5.0 * cy[0] * x + dfdD;
            dfdD = dfdD * x + 3.0 * cy[2];
            dfdD2 = dfdD2 * x + dfdD;
            dfdD = dfdD * x + 2.0 * cy[3];
            dfdD2 = dfdD2 * x + dfdD;
            dfdD = dfdD * x + cy[4];
            dfdD2 = dfdD2 * e.inv_dx * e.inv_dx;
            dfdD = dfdD * e.inv_dx;
            }
        const double residual = D * D * dfdD - P;
        if (fabs(residual) < P_tol) break;
        D = D - residual / (2.0 * D * dfdD + D * D * dfdD2);
        }

    if (iter >= max_iter)
        {
        zero_state(state);
        return 206;   
        }

    if (e.x_low < D_form_switch)
        {
        const double ln_D = log(D);
        f = (((cy[0] * x + cy[1]) * x + cy[2]) * x + cy[3]) * x + cy[4] + cy[5] * ln_D;
        dfdT2 = (((((cy_dT2[0]) * x + cy_dT2[1]) * x + cy_dT2[2]) * x + cy_dT2[3]) * x + cy_dT2[4] + cy_dT2[5] * ln_D) * e.inv_dy * e.inv_dy;
        dfdT = cy_dT[0] * x + cy_dT[1];
        dfdDdT = cy_dT[0] * x + dfdT;
        dfdT = dfdT * x + cy_dT[2];
        dfdDdT = dfdDdT * x + dfdT;
        dfdT = dfdT * x + cy_dT[3];
        dfdDdT = ((dfdDdT * x + dfdT) * e.inv_dx + cy_dT[5] / D) * e.inv_dy;
        dfdT = (dfdT * x + cy_dT[4] + cy_dT[5] * ln_D) * e.inv_dy;
        }
    else
        {
        f = ((((cy[0] * x + cy[1]) * x + cy[2]) * x + cy[3]) * x + cy[4]) * x + cy[5];
        dfdT2 = (((((cy_dT2[0] * x + cy_dT2[1]) * x + cy_dT2[2]) * x + cy_dT2[3]) * x + cy_dT2[4]) * x + cy_dT2[5]) * e.inv_dy * e.inv_dy;
        dfdT = cy_dT[0] * x + cy_dT[1];
        dfdDdT = cy_dT[0] * x + dfdT;
        dfdT = dfdT * x + cy_dT[2];
        dfdDdT = dfdDdT * x + dfdT;
        dfdT = dfdT * x + cy_dT[3];
        dfdDdT = dfdDdT * x + dfdT;
        dfdT = dfdT * x + cy_dT[4];
        dfdDdT = dfdDdT * x + dfdT;
        dfdT = dfdT * x + cy_dT[5];
        dfdDdT = dfdDdT * e.inv_dx * e.inv_dy;
        dfdT = dfdT * e.inv_dy;
        }

    double Q = 999.0;
    if (T < T_crit)
        {
        Q = (dens_vap * (dens_liq - D)) / (D * (dens_liq - dens_vap));
        }
    else if (P < P_crit)
        {
        Q = 998.0;
        }
    const double inte = f - T * dfdT;
    
    state->temp = T;
    state->pres = D * D * dfdD;
    state->dens = D;
    state->qual = Q;
    state->inte = inte;
    state->enth = inte + D * dfdD;
    state->entr = -dfdT;
    state->cv = -T * dfdT2;
    state->cp = T * (D * dfdDdT * dfdDdT / (2.0 * dfdD + D * dfdD2) - dfdT2);
    state->ssnd = sqrt( 1000.0 * D * D * (dfdD2 - dfdDdT * dfdDdT / dfdT2 + 2.0 * dfdD / D) );
    state->sat_vap_dens = dens_vap;
    state->sat_liq_dens = dens_liq;
    return 0;
    }

int water_PH( const double P, const double H, water_state * __restrict state )
    {
    const int max_iter = 20;
    const double rel_tol = 1e-10;
    const double P_tol = fmax(rel_tol, P * rel_tol);
    const double H_tol = fmax(rel_tol, fabs(H) * rel_tol);
    Element e;

    if (P < P_crit)
        {
        if (P < P_lower_limit)
            {
            zero_state(state);
            return 303;
            }
        const double sat_T = water_sat_temp(P);

        // Check saturated vapor state.
        const double dens_vap = water_sat_vap_dens(sat_T);
        find_element(sat_T, dens_vap, &e);
        const double x_vap = (dens_vap - e.x_low) * e.inv_dx;
        const double y_vap = (sat_T - e.y_low) * e.inv_dy;
        double f_vap, dfdD_vap, dfdT_vap;
        get_two_phase_derivatives(x_vap, y_vap, dens_vap, &e, &f_vap, &dfdD_vap, &dfdT_vap);
        const double enth_vap = f_vap - sat_T * dfdT_vap + dens_vap * dfdD_vap;
        if (H < enth_vap)
            {

            // Check saturated liquid state.
            const double dens_liq = water_sat_liq_dens(sat_T);
            find_element(sat_T, dens_liq, &e);
            const double x_liq = (dens_liq - e.x_low) * e.inv_dx;
            const double y_liq = (sat_T - e.y_low) * e.inv_dy;
            double f_liq, dfdD_liq, dfdT_liq;
            get_two_phase_derivatives(x_liq, y_liq, dens_liq, &e, &f_liq, &dfdD_liq, &dfdT_liq);
            const double enth_liq = f_liq - sat_T * dfdT_liq + dens_liq * dfdD_liq;
            if (H > enth_liq)  // two-phase
                {
                const double Q = (H - enth_liq) / (enth_vap - enth_liq);
                const double D = dens_vap * dens_liq / (Q * (dens_liq - dens_vap) + dens_vap);
                const double inte_liq = f_liq - sat_T * dfdT_liq;
                const double inte_vap = f_vap - sat_T * dfdT_vap;
                state->temp = sat_T;
                state->pres = dens_vap * dens_vap * dfdD_vap;  // vapor pressure slightly more accurate
                state->dens = D;
                state->qual = Q;
                state->inte = inte_liq + Q * (inte_vap - inte_liq);
                state->enth = enth_liq + Q * (enth_vap - enth_liq);
                state->entr = Q * (dfdT_liq - dfdT_vap) - dfdT_liq;  // negative signs change order of terms
                state->cv = 0.0;
                state->cp = 0.0;
                state->ssnd = 0.0;
                state->sat_vap_dens = dens_vap;
                state->sat_liq_dens = dens_liq;
                return 0;
                }
            } 
        }               
    else if (P > P_upper_limit)
        {
        zero_state(state);
        return 304;
        }

    double T = water_ph_temp(P, H);
    double D = water_ph_dens(P, H);
    find_element(T, D, &e);

    int iter;
    double f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2;
    for ( iter = 0; iter < max_iter; ++iter )
        {
        double x = (D - e.x_low) * e.inv_dx;
        double y = (T - e.y_low) * e.inv_dy;
        if (y < -0.01 || y > 1.01 || x < -0.01 || x > 1.01)  // outside element
            {
            find_element(T, D, &e);
            x = (D - e.x_low) * e.inv_dx;
            y = (T - e.y_low) * e.inv_dy;
            }        
        get_derivatives(x, y, D, &e, &f, &dfdD, &dfdD2, &dfdT, &dfdDdT, &dfdT2);
        const double calc_P = D * D * dfdD;
        const double calc_H = f - T * dfdT + D * dfdD;
        const double P_res = calc_P - P;
        const double H_res = calc_H - H;
        if (fabs(P_res) < P_tol && fabs(H_res) < H_tol) break;  // converged

        // Create the Jacobian.
        const double J_11 = 2.0 * D * dfdD + D * D * dfdD2;  // dP_res / dD
        const double J_12 = D * D * dfdDdT; // dP_res / dT
        const double J_21 = dfdD - T * dfdDdT + dfdD + D * dfdD2;  // dH_res / dD
        const double J_22 = dfdT - dfdT - T * dfdT2 + D * dfdDdT;  // dH_res / dT

        // Solve J * deltas = residuals for deltas and update x and y.
        const double alpha = J_21 / J_11;
        const double beta = J_22 - J_12 * alpha;
        const double gamma = H_res - P_res * alpha;
        const double delta_y = gamma / beta;
        const double delta_x = (P_res - J_12 * delta_y) / J_11;
        D = D - delta_x;
        T = T - delta_y;
        if (fabs(delta_x) < 1e-12 && fabs(delta_y) < 1e-12)
            {
            if (fabs(P_res) < P_tol * 10.0 && fabs(H_res) < H_tol * 10.0) break;  // converged enough
            }
        }

    if (iter >= max_iter)
        {
        zero_state(state);
        return 305;   
        }
    if (T < T_lower_limit)
        {
        zero_state(state);
        return 301;   
        }
    if (T > T_upper_limit)
        {
        zero_state(state);
        return 302;        
        }

    double D_vap = 0.0;
    double D_liq = 0.0;
    double Q = 999.0;
    if (T < T_crit)
        {
        D_vap = water_sat_vap_dens(T);
        D_liq = water_sat_liq_dens(T);
        Q = (D_vap * (D_liq - D)) / (D * (D_liq - D_vap));
        }
    else if (P < P_crit)
        {
        Q = 998.0;
        }
    const double inte = f - T * dfdT;

    state->temp = T;
    state->pres = D * D * dfdD;
    state->dens = D;
    state->qual = Q;
    state->inte = inte;
    state->enth = inte + D * dfdD;
    state->entr = -dfdT;
    state->cv = -T * dfdT2;
    state->cp = T * (D * dfdDdT * dfdDdT / (2.0 * dfdD + D * dfdD2) - dfdT2);
    state->ssnd = sqrt( 1000.0 * D * D * (dfdD2 - dfdDdT * dfdDdT / dfdT2 + 2.0 * dfdD / D) );
    state->sat_vap_dens = D_vap;
    state->sat_liq_dens = D_liq;
    return 0;
    }

int water_PS( const double P, const double S, water_state * __restrict state )
    {
    const int max_iter = 20;
    const double rel_tol = 1e-10;
    const double P_tol = fmax(rel_tol, P * rel_tol);
    const double S_tol = fmax(rel_tol, fabs(S) * rel_tol);
    Element e;

    if (P < P_crit)
        {
        if (P < P_lower_limit)
            {
            zero_state(state);
            return 403;
            }
        const double sat_T = water_sat_temp(P);

        // Check saturated vapor state.
        const double dens_vap = water_sat_vap_dens(sat_T);
        find_element(sat_T, dens_vap, &e);
        const double x_vap = (dens_vap - e.x_low) * e.inv_dx;
        const double y_vap = (sat_T - e.y_low) * e.inv_dy;
        double f_vap, dfdD_vap, dfdT_vap;
        get_two_phase_derivatives(x_vap, y_vap, dens_vap, &e, &f_vap, &dfdD_vap, &dfdT_vap);
        const double entr_vap = -dfdT_vap;
        if (S < entr_vap)
            {

            // Check saturated liquid state.
            const double dens_liq = water_sat_liq_dens(sat_T);
            find_element(sat_T, dens_liq, &e);
            const double x_liq = (dens_liq - e.x_low) * e.inv_dx;
            const double y_liq = (sat_T - e.y_low) * e.inv_dy;
            double f_liq, dfdD_liq, dfdT_liq;
            get_two_phase_derivatives(x_liq, y_liq, dens_liq, &e, &f_liq, &dfdD_liq, &dfdT_liq);
            const double entr_liq = -dfdT_liq;
            if (S > entr_liq)  // two-phase
                {
                const double Q = (S - entr_liq) / (entr_vap - entr_liq);
                const double D = dens_vap * dens_liq / (Q * (dens_liq - dens_vap) + dens_vap);
                const double inte_liq = f_liq - sat_T * dfdT_liq;
                const double inte_vap = f_vap - sat_T * dfdT_vap;
                const double enth_liq = inte_liq + dens_liq * dfdD_liq;
                const double enth_vap = inte_vap + dens_vap * dfdD_vap;
                state->temp = sat_T;
                state->pres = dens_vap * dens_vap * dfdD_vap;  // vapor pressure slightly more accurate
                state->dens = D;
                state->qual = Q;
                state->inte = inte_liq + Q * (inte_vap - inte_liq);
                state->enth = enth_liq + Q * (enth_vap - enth_liq);
                state->entr = entr_liq + Q * (entr_vap - entr_liq);
                state->cv = 0.0;
                state->cp = 0.0;
                state->ssnd = 0.0;
                state->sat_vap_dens = dens_vap;
                state->sat_liq_dens = dens_liq;
                return 0;
                }
            } 
        }               
    else if (P > P_upper_limit)
        {
        zero_state(state);
        return 404;
        }

    double T = water_ps_temp(P, S);
    double D = water_ps_dens(P, S);
    find_element(T, D, &e);

    int iter;
    double f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2;
    for ( iter = 0; iter < max_iter; ++iter )
        {
        double x = (D - e.x_low) * e.inv_dx;
        double y = (T - e.y_low) * e.inv_dy;
        if (y < -0.01 || y > 1.01 || x < -0.01 || x > 1.01)  // outside element
            {
            find_element(T, D, &e);
            x = (D - e.x_low) * e.inv_dx;
            y = (T - e.y_low) * e.inv_dy;
            }        
        get_derivatives(x, y, D, &e, &f, &dfdD, &dfdD2, &dfdT, &dfdDdT, &dfdT2);
        const double calc_P = D * D * dfdD;
        const double calc_S = -dfdT;
        const double P_res = calc_P - P;
        const double S_res = calc_S - S;
        if (fabs(P_res) < P_tol && fabs(S_res) < S_tol) break;  // converged

        // Create the Jacobian.
        const double J_11 = 2.0 * D * dfdD + D * D * dfdD2;  // dP_res / dD
        const double J_12 = D * D * dfdDdT; // dP_res / dT
        const double J_21 = -dfdDdT;  // dS_res / dD
        const double J_22 = -dfdT2;  // dS_res / dT

        // Solve J * deltas = residuals for deltas and update x and y.
        const double alpha = J_21 / J_11;
        const double beta = J_22 - J_12 * alpha;
        const double gamma = S_res - P_res * alpha;
        const double delta_y = gamma / beta;
        const double delta_x = (P_res - J_12 * delta_y) / J_11;
        D = D - delta_x;
        T = T - delta_y;
        if (fabs(delta_x) < 1e-12 && fabs(delta_y) < 1e-12)
            {
            if (fabs(P_res) < P_tol * 10.0 && fabs(S_res) < S_tol * 10.0) break;  // converged enough
            }
        }

    if (iter >= max_iter)
        {
        zero_state(state);
        return 405;   
        }
    if (T < T_lower_limit)
        {
        zero_state(state);
        return 401;   
        }
    if (T > T_upper_limit)
        {
        zero_state(state);
        return 402;        
        }

    double D_vap = 0.0;
    double D_liq = 0.0;
    double Q = 999.0;
    if (T < T_crit)
        {
        D_vap = water_sat_vap_dens(T);
        D_liq = water_sat_liq_dens(T);
        Q = (D_vap * (D_liq - D)) / (D * (D_liq - D_vap));
        }
    else if (P < P_crit)
        {
        Q = 998.0;
        }
    const double inte = f - T * dfdT;

    state->temp = T;
    state->pres = D * D * dfdD;
    state->dens = D;
    state->qual = Q;
    state->inte = inte;
    state->enth = inte + D * dfdD;
    state->entr = -dfdT;
    state->cv = -T * dfdT2;
    state->cp = T * (D * dfdDdT * dfdDdT / (2.0 * dfdD + D * dfdD2) - dfdT2);
    state->ssnd = sqrt( 1000.0 * D * D * (dfdD2 - dfdDdT * dfdDdT / dfdT2 + 2.0 * dfdD / D) );
    state->sat_vap_dens = D_vap;
    state->sat_liq_dens = D_liq;
    return 0;
    }

int water_HS( const double H, const double S, water_state * __restrict state )
    {
    const int max_iter = 30;
    const double rel_tol = 1e-10;
    const double H_tol = fmax(rel_tol, fabs(H) * rel_tol);
    const double S_tol = fmax(rel_tol, fabs(S) * rel_tol);
    int iter;
    double T, D;
    T = water_sh_temp(S, H);
    D = water_sh_dens(S, H);
    for ( iter = 0; iter < max_iter; ++iter )
        {
        double dPdD, dhdD, dsdD, dPdT, dhdT, dsdT, dDdP, dDdT, pres, calc_H, calc_S;
        if (T < T_lower_limit) T = T_lower_limit;
        if (D <= 0.0) D = 0.01;
        get_prop_derivatives(T, D, &dPdD, &dhdD, &dsdD, &dPdT, &dhdT, &dsdT, &dDdP, &dDdT, &pres, &calc_H, &calc_S);
        const double H_res = calc_H - H;
        const double S_res = calc_S - S;
        if (fabs(H_res) < H_tol && fabs(S_res) < S_tol) break;  // converged
        const double J_11 = dhdD;
        const double J_12 = dhdT;
        const double J_21 = dsdD;
        const double J_22 = dsdT;
        const double alpha = J_21 / J_11;
        const double beta = J_22 - J_12 * alpha;
        const double gamma = S_res - H_res * alpha;
        const double delta_y = gamma / beta;
        const double delta_x = (H_res - J_12 * delta_y) / J_11;
        D = D - delta_x;
        T = T - delta_y;
        if (fabs(delta_x) < 1e-12 && fabs(delta_y) < 1e-12)
            {
            if (fabs(H_res) < H_tol * 10.0 && fabs(S_res) < S_tol * 10.0) break;  // converged enough
            }
        }

    if (iter >= max_iter)  // did not converge; check two-phase initial guess
        {
        T = water_sh_two_phase_temp(S, H);
        const double dens_liq = water_sat_liq_dens(T);
        const double dens_vap = water_sat_vap_dens(T);
        Element e;
        find_element(T, dens_liq, &e);
        const double x_liq = (dens_liq - e.x_low) * e.inv_dx;
        const double y_liq = (T - e.y_low) * e.inv_dy;
        double f_liq, dfdD_liq, dfdT_liq;
        get_two_phase_derivatives(x_liq, y_liq, dens_liq, &e, &f_liq, &dfdD_liq, &dfdT_liq);
        find_element(T, dens_vap, &e);
        const double x_vap = (dens_vap - e.x_low) * e.inv_dx;
        const double y_vap = (T - e.y_low) * e.inv_dy;
        double f_vap, dfdD_vap, dfdT_vap;
        get_two_phase_derivatives(x_vap, y_vap, dens_vap, &e, &f_vap, &dfdD_vap, &dfdT_vap);
        const double Q = (S + dfdT_liq) / (dfdT_liq - dfdT_vap);
        D = dens_vap * dens_liq / (Q * (dens_liq - dens_vap) + dens_vap);
        for ( iter = 0; iter < max_iter; ++iter )
            {
            double dPdD, dhdD, dsdD, dPdT, dhdT, dsdT, dDdP, dDdT, pres, calc_H, calc_S;
            if (T < T_sat_min) T = T_sat_min;
            if (D <= 0.0) D = 0.01;
            get_prop_derivatives(T, D, &dPdD, &dhdD, &dsdD, &dPdT, &dhdT, &dsdT, &dDdP, &dDdT, &pres, &calc_H, &calc_S);
            const double H_res = calc_H - H;
            const double S_res = calc_S - S;
            if (fabs(H_res) < H_tol && fabs(S_res) < S_tol) break;  // converged
            const double J_11 = dhdD;
            const double J_12 = dhdT;
            const double J_21 = dsdD;
            const double J_22 = dsdT;
            const double alpha = J_21 / J_11;
            const double beta = J_22 - J_12 * alpha;
            const double gamma = S_res - H_res * alpha;
            const double delta_y = gamma / beta;
            const double delta_x = (H_res - J_12 * delta_y) / J_11;
            D = D - delta_x;
            T = T - delta_y;
            if (fabs(delta_x) < 1e-12 && fabs(delta_y) < 1e-12)
                {
                if (fabs(H_res) < H_tol * 10.0 && fabs(S_res) < S_tol * 10.0) break;  // converged enough
                }            
            }
        }

    if (iter >= max_iter)  // did not converge; check two-phase initial guess
        {
        zero_state(state);
        return 505;
        }

    int error_code;
    error_code = water_TD(T, D, state);
    if (error_code > 0) error_code = error_code + 400;  // 101 -> 501, etc.
    return error_code;
    }

int water_TQ( const double T, const double Q, water_state * __restrict state )
    {
    if (T < T_sat_min)
        {
        zero_state(state);
        return 601;
        }
    if (T >= T_crit)
        {
        zero_state(state);
        return 602;
        }
    if (Q < 0.0 || Q > 1.0)
        {
        zero_state(state);
        return 603;
        }
    const double dens_vap = water_sat_vap_dens(T);
    const double dens_liq = water_sat_liq_dens(T);
    if (Q < 1e-12 || 1.0-Q < 1e-12)
        {
        double D;
        if (Q < 1e-12)  // single-phase saturated liquid
            {
            D = dens_liq;
            }
        else  // single-phase saturated vapor
            {
            D = dens_vap;
            }
        Element e;
        find_element(T, D, &e);
        const double x = (D - e.x_low) * e.inv_dx;
        const double y = (T - e.y_low) * e.inv_dy;
        double f, dfdD, dfdD2, dfdT, dfdDdT, dfdT2;
        get_derivatives(x, y, D, &e, &f, &dfdD, &dfdD2, &dfdT, &dfdDdT, &dfdT2);
        const double inte = f - T * dfdT;
        state->temp = T;
        state->pres = D * D * dfdD;
        state->dens = D;
        state->qual = Q;
        state->inte = inte;
        state->enth = inte + D * dfdD;
        state->entr = -dfdT;
        state->cv = -T * dfdT2;
        state->cp = T * (D * dfdDdT * dfdDdT / (2.0 * dfdD + D * dfdD2) - dfdT2);
        state->ssnd = sqrt( 1000.0 * D * D * (dfdD2 - dfdDdT * dfdDdT / dfdT2 + 2.0 * dfdD / D) );
        state->sat_vap_dens = dens_vap;
        state->sat_liq_dens = dens_liq;
        return 0;
        }
    Element e;
    find_element(T, dens_liq, &e);
    const double x_liq = (dens_liq - e.x_low) * e.inv_dx;
    const double y_liq = (T - e.y_low) * e.inv_dy;
    double f_liq, dfdD_liq, dfdT_liq;
    get_two_phase_derivatives(x_liq, y_liq, dens_liq, &e, &f_liq, &dfdD_liq, &dfdT_liq);
    find_element(T, dens_vap, &e);
    const double x_vap = (dens_vap - e.x_low) * e.inv_dx;
    const double y_vap = (T - e.y_low) * e.inv_dy;
    double f_vap, dfdD_vap, dfdT_vap;
    get_two_phase_derivatives(x_vap, y_vap, dens_vap, &e, &f_vap, &dfdD_vap, &dfdT_vap);
    const double inte_liq = f_liq - T * dfdT_liq;
    const double inte_vap = f_vap - T * dfdT_vap;
    const double enth_liq = inte_liq + dens_liq * dfdD_liq;
    const double enth_vap = inte_vap + dens_vap * dfdD_vap;
    state->temp = T;
    state->pres = dens_vap * dens_vap * dfdD_vap;  // vapor pressure slightly more accurate
    state->dens = dens_vap * dens_liq / (Q * (dens_liq - dens_vap) + dens_vap);
    state->qual = Q;
    state->inte = inte_liq + Q * (inte_vap - inte_liq);
    state->enth = enth_liq + Q * (enth_vap - enth_liq);
    state->entr = Q * (dfdT_liq - dfdT_vap) - dfdT_liq;  // negative signs change order of terms
    state->cv = 0.0;
    state->cp = 0.0;
    state->ssnd = 0.0;
    state->sat_vap_dens = dens_vap;
    state->sat_liq_dens = dens_liq;
    return 0;
    }

